import { Stack, Typography } from "@mui/material"
import AddIcon from '@mui/icons-material/Add';

const Sidebar = () => {
  return (
    <div style={{backgroundColor: 'red', height: '100vh', width: '15%', zIndex: '100', position:'absolute'}}>
      <div style={{display: 'flex', paddingLeft: '10px', paddingTop: '10px', justifyContent: 'space-between'}}>
        <h1 style={{margin: 0}}>Notes</h1>
        <div style={{marginRight: '10px', backgroundColor: "white", display: "flex", justifyContent: 'center'}}>
          <AddIcon/>
        </div>
      </div>
    </div>
  )
}

export default Sidebar
